import React, { Component } from "react";
import Link from 'next/link';

class Header extends Component {
    render() {
        const style = { height: 70 }
        return (
            <div className="container" style={{background:'red'}}>
                <div className="row">
                    <div className="col-md-8 text-left">
                        <h1 className="text-success">
                            <img style={{ height: 70}} src="/static/images/logo/logo.png" alt="" />
                            {" "} AOWSAY {" "}
                        </h1>
                    </div>
                    <div className="col-md-4 text-right">
                        <h5 className ="text-muted mt-4">
                            TEST
                        </h5>
                        <ul className="list-inline">
                            <li className="list-inline-item title"><Link href="/"><a>HOME</a></Link></li>
                            <li className="list-inline-item title"><Link href="/about"><a>ABOUT</a></Link></li>
                        </ul>
                    </div>
                </div>
            </div>
        )
    }
}

export default Header;
